package inheratance;

public class Childclass extends Parentclass {
	public void Manu() {
		System.out.println("Blue");
	}
	public void Mani() {
		System.out.println("White");
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Childclass j=new Childclass();
		j.Manu();
		j.Mani();
		j.Mahesh();
		j.Reddy();

	}

}
